import styles from './UsersList.module.css'
import Card from "../UI/Card";

const UsersList = ({users}) => {
  return (
    <div className={styles.users}>
        <ul>
          {users.map(user => (
            <li key={user.id}>
              {user.username} ({user.age} years old)
            </li>
          ))}
        </ul>
    </div>
  )
}

export default UsersList
